INSERT INTO `oldplace` VALUES (259,'Colosseum','41.89037789425863 12.49227381074512','Piazza del Colosseo, 1, 00184 Roma RM, Italy','The Colosseum is an ancient amphitheater located in Rome, Italy. It is one of the most iconic landmarks of the Roman Empire and a popular tourist attraction.',1,42.00,2.00),(260,'Roman Forum','41.89267790743491 12.485303537730914','Via della Salara Vecchia, 5/6, 00186 Roma RM, Italy','The Roman Forum is a rectangular plaza surrounded by the ruins of several important ancient government buildings. It served as the center of Roman public life for centuries.',1,55.00,2.00),(261,'Pantheon','41.89873854344063 12.476787064716968','Piazza della Rotonda, 00186 Roma RM, Italy','The Pantheon is a former Roman temple and now a church. It is known for its impressive dome and the oculus in the center, which allows natural light to enter the building.',1,12.00,3.00),(262,'Trevi Fountain','41.90106521310689 12.483337318417298','Piazza di Trevi, 00187 Roma RM, Italy','The Trevi Fountain is a famous Baroque fountain in Rome. It is known for its stunning sculptures and is a popular spot for visitors to throw coins into the water.',1,51.00,3.00),(263,'Vatican City','41.90383220521926 12.452619081233724','Vatican City','Vatican City is an independent city-state surrounded by Rome, Italy. It is the spiritual and administrative headquarters of the Roman Catholic Church and home to St. Peter\'s Basilica and the Vatican Museums.',1,42.00,5.00),(264,'Spanish Steps','41.90613628317672 12.482754345403203','Piazza di Spagna, 00187 Roma RM, Italy','The Spanish Steps is a famous staircase in Rome, connecting the Piazza di Spagna at the bottom with the Trinit���� dei Monti church at the top. It is a popular meeting point and gathering place.',1,28.00,3.00),(265,'Castel Sant\'Angelo','41.903238845697494 12.466318910745905','Lungotevere Castello, 50, 00193 Roma RM, Italy','Castel Sant\'Angelo is a fortress located on the right bank of the Tiber River in Rome. It has served various purposes throughout history, including as a mausoleum, a castle, and a museum.',1,17.00,4.00),(266,'Palatine Hill','41.89067915447399 12.48755174110535','Via di San Gregorio, 00186 Roma RM, Italy','Palatine Hill is one of the seven hills of Rome and is considered the centermost of the famous Seven Hills of Rome. It offers panoramic views of the Roman Forum and the Circus Maximus.',1,27.00,5.00),(267,'Baths of Caracalla','41.87915799439464 12.492385751222889','Viale delle Terme di Caracalla,52, 00153 Roma RM, Italy','The Baths of Caracalla were ancient Roman public baths built during the reign of Emperor Caracalla. They were one of the largest and most impressive thermal complexes in ancient Rome.',1,31.00,2.00),(268,'Piazza Navona','41.8992680495627 12.473055380059884','Piazza Navona, 00186 Roma RM, Italy','Piazza Navona is a beautiful square in Rome, famous for its Baroque architecture and stunning fountains. It is a lively gathering place and a hub of activity with numerous cafes and street performers.',1,17.00,4.00),(269,'Circus Maximus','41.886333054191944 12.485154953073383','Via del Circo Massimo, 00186 Roma RM, Italy','Circus Maximus is an ancient Roman chariot racing stadium and entertainment venue. It was the largest stadium in ancient Rome and could accommodate over 150,000 spectators.',1,15.00,4.00),(270,'Capitoline Hill','41.89454118023064 12.483145121603664','Piazza del Campidoglio, 00186 Roma RM, Italy','Capitoline Hill is one of the seven hills of Rome and was the citadel of the ancient city. It now houses the Capitoline Museums, which showcase a vast collection of ancient art and artifacts.',1,20.00,3.00),(271,'Ara Pacis','41.905165983511274 12.475265522388867','Lungotevere in Augusta, 00186 Roma RM, Italy','The Ara Pacis is an ancient altar dedicated to the Roman goddess of peace, Pax. It is considered one of the most important works of Roman sculpture and is housed in a modern museum building.',1,10.00,2.00),(272,'Basilica of Santa Maria Maggiore','41.89773433134623 12.498386937731235','Piazza di Santa Maria Maggiore, 42, 00185 Roma RM, Italy','The Basilica of Santa Maria Maggiore is one of the major basilicas in Rome and is dedicated to the Virgin Mary. It is known for its beautiful mosaics and stunning interior.',1,5.00,3.00),(273,'Palazzo Barberini','41.903294089802266 12.489944012595991','Via delle Quattro Fontane, 13, 00184 Roma RM, Italy','Palazzo Barberini is a palace in Rome that houses the Galleria Nazionale d\'Arte Antica, an art gallery with a vast collection of paintings, sculptures, and other artworks.',1,25.00,5.00),(274,'Campo de\' Fiori','41.89553744984559 12.472223453073946','Campo de\' Fiori, 00186 Roma RM, Italy','Campo de\' Fiori is a lively square in Rome known for its bustling market during the day and vibrant nightlife. It is surrounded by restaurants, cafes, and historic buildings.',1,0.00,5.00),(275,'Santa Maria in Trastevere','41.88959680099575 12.469814637730664','Piazza di Santa Maria in Trastevere, 00153 Roma RM, Italy','Santa Maria in Trastevere is one of the oldest churches in Rome and is located in the charming Trastevere neighborhood. It is known for its beautiful mosaics and stunning interior.',1,10.00,4.00),(276,'Pietre d\'inciampo in memoria di Tranquillo di Veroli, Marco di Veroli','41.894588679167754 12.476140037731035','Largo Arenula, 26, 00186 Roma RM, Italy','The Stolpersteine, also known as stumbling stones, are small metal plaques placed in the urban fabric of certain European cities to commemorate the victims of the Holocaust. This initiative was created by German artist Gunter Demnig.\nIn the context of Rome, some of these stones have been placed at Vicolo Costaguti, 24 to honor Clelia and Marcella Perugia, as well as Giuditta and Pacifico Di Veroli.',1,8.00,2.00),(277,'Arch of Constantine','41.889923087335376 12.490731839580757','Via di San Gregorio, 00186 Roma RM, Italy','The Arch of Constantine is a triumphal arch in Rome, located near the Colosseum. It was built to commemorate the victory of Constantine the Great and is known for its well-preserved reliefs.',1,5.00,4.00),(278,'Milan Cathedral','45.46414163933181 9.191935903417761','Piazza del Duomo, 20122 Milano MI, Italy.','Milan Cathedral (Duomo di Milano) - This magnificent cathedral is one of the largest Gothic cathedrals in the world. Its elaborate facade and stunning interior features intricate sculptures, stained glass windows, and a rooftop terrace offering panoramic views of the city.',2,42.00,4.00),(279,'Sforza Castle','45.470498771643285 9.1793325','Piazza Castello, 20121 Milano MI, Italy.','Sforza Castle (Castello Sforzesco) - A grand medieval fortress, Sforza Castle showcases a mix of architectural styles and houses several museums and art collections. Visitors can explore its courtyards, gardens, and historical rooms filled with sculptures and paintings.',2,55.00,3.00),(280,'The Last Supper (Il Cenacolo)','45.466244546673416 9.170604116823023','Piazza di Santa Maria delle Grazie, 20123 Milano MI, Italy.','The Last Supper (Il Cenacolo) - Housed in the refectory of the Convent of Santa Maria delle Grazie, Leonardo da Vinci\'s masterpiece, The Last Supper, depicts the biblical scene of Jesus and his disciples. It is renowned for its intricate details and use of perspective.',2,12.00,3.00),(281,'Brera Art Gallery (Pinacoteca di Brera)','45.47203014780333 9.187813913908588','Via Brera, 28, 20121 Milano MI, Italy.','Brera Art Gallery (Pinacoteca di Brera) - This art museum houses an impressive collection of Italian Renaissance and Baroque artworks. Visitors can admire masterpieces by artists such as Raphael, Caravaggio, and Titian.',2,51.00,3.00),(282,'La Scala Opera House (Teatro alla Scala)','45.467439721452244 9.189551200000002','Via Filodrammatici, 2, 20121 Milano MI, Italy.','Galleria Vittorio Emanuele II - Known as one of the world\'s oldest shopping malls, this elegant arcade is adorned with beautiful mosaics and features high-end boutiques, cafes, and restaurants. It connects Piazza del Duomo with Piazza della Scala.',2,42.00,3.00),(283,'Galleria Vittorio Emanuele II','45.46620636798135 9.189758957622473','Piazza del Duomo, 20123 Milano MI, Italy.','La Scala Opera House (Teatro alla Scala) - One of the most prestigious opera houses in the world, La Scala is renowned for its opulent interiors and exceptional acoustics. It has hosted renowned opera performances and ballets for centuries.',2,28.00,5.00),(284,'Santa Maria delle Grazie','45.46603072031877 9.17094064228608','Piazza di Santa Maria delle Grazie, 20123 Milano MI, Italy.','Santa Maria delle Grazie - This UNESCO World Heritage site is a stunning example of Renaissance architecture. Apart from housing The Last Supper, the church itself boasts beautiful chapels, frescoes, and a tranquil courtyard.',2,17.00,4.00),(285,'Navigli Canals','45.45145437455379 9.170989190785148','Navigli District, 20123 Milano MI, Italy.','Navigli Canals - Once used for transportation, the Navigli Canals now offer a lively atmosphere with numerous bars, restaurants, and art galleries. It\'s a popular spot to enjoy a leisurely stroll and take in the charming ambiance.',2,27.00,4.00),(286,'Arch of Peace (Arco della Pace)','45.47578756272773 9.172458555656284','Piazza Sempione, 20154 Milano MI, Italy.','Arch of Peace (Arco della Pace) - A neoclassical triumphal arch, the Arch of Peace stands at the entrance of Parco Sempione. It serves as a symbol of peace and commemorates Napoleon\'s victories.',2,31.00,2.00),(287,'Basilica of Sant\'Ambrogio','45.46242702452528 9.175611999982229','Piazza Sant\'Ambrogio, 15, 20123 Milano MI, Italy.','Basilica of Sant\'Ambrogio - One of the oldest churches in Milan, this Romanesque basilica is dedicated to Saint Ambrose, the city\'s patron saint. It features impressive mosaics, a beautiful courtyard, and a rich history dating back to the 4th century.',2,17.00,2.00),(288,'Leonardo da Vinci National Museum of Science and Technology','45.462325046